<script>
import { mapState, mapMutations } from 'vuex';
import avatarImg from '@/assets/default.gif';
// import logo from '@/assets/c.png';
import i18nStoreModule from './i18n-store-module';
import Cookies from 'js-cookie';
export default {
  name: 'Navbar',
  props: {
    /**
     * 用户信息
     */
    user: {
      type: Object,
      default: () => {
        return {
          avatar: avatarImg,
          name: 'Anonymous User'
        };
      }
    },
    i18nList: {
      type: Array,
      default: () => {
        return [
          {
            key: 'zh_CN',
            value: '中文'
          },
          {
            key: 'en_US',
            value: 'English'
          }
        ];
      }
    },

    home: {
      type: Object,
      default: () => {
        return {
          enable: true,
          link: '/',
          outerLink: false
        };
      }
    },
    account: {
      type: Object,
      default: () => {
        return {
          enable: true,
          logout: '/logout',
          login: '/login'
        };
      }
    }
  },
  data() {
    return {
      // logo,
      defaultAvatar: avatarImg
    };
  },
  computed: {
    ...mapState({
      currentLanguage(state) {
        return (state.i18n && state.i18n.currentLanguage) || this.$i18n.locale;
      }
    }),
    locale() {
      const localValue = this.i18nList.filter(item => {
        return item.key === this.currentLanguage;
      });
      return localValue[0] && localValue[0].value;
    }
  },
  watch: {
    currentLanguage(lang) {
      this.$i18n.locale = lang;
    }
  },
  created() {
    this.$store.registerModule('i18n', i18nStoreModule);
    this.$store.commit('SET_ROLE', window.config.role);
    this.$store.commit('SET_USER', window.config.user);
    this.initLocale();
  },
  methods: {
    ...mapMutations({
      changeLanguage: 'i18n/changeLanguage'
    }),
    doLogout() {
      window.location.href = `${this.account.logout}?returnUrl=${
        this.$route.fullPath
      }`;
    },
    doLogin() {
      window.location.href = `${this.account.login}`;
    },
    initLocale() {
      const locale = this.getInitLanguage();
      this.changeLanguage(locale);
      Cookies.set('language', locale);
    },
    getInitLanguage() {
      return Cookies.get('language') || this.currentLanguage;
    },
    handleLanguageChange(command) {
      this.changeLanguage(command);
      Cookies.set('language', command);
    }
  }
};
</script>
